handle_table = {    ["UR"] = function(gesture_str)  -- Right tab        LibHandle.keyWithFlags(kVK_ANSI_RightBracket, xor(kCGEventFlagMaskShift,kCGEventFlagMaskCommand))    end,    ["UL"] = function(gesture_str)  -- Left tab        LibHandle.keyWithFlags(kVK_ANSI_LeftBracket, xor(kCGEventFlagMaskShift,kCGEventFlagMaskCommand))    end,    ["DL"] = function(gesture_str)  -- Toggle maxize        LibHandle.keyWithFlags(kVK_ANSI_F, xor(kCGEventFlagMaskCommand,kCGEventFlagMaskControl))    end,    ["DR"] = function(gesture_str)  -- Close tab        LibHandle.keyWithFlags(kVK_ANSI_W, kCGEventFlagMaskCommand)    end,    ["R"] = function (gesture_str)  -- Go Forward        LibHandle.keyWithFlags(kVK_RightArrow, kCGEventFlagMaskCommand)    end,    ["L"] = function (gesture_str)  -- Go Back        LibHandle.keyWithFlags(kVK_LeftArrow, kCGEventFlagMaskCommand)    end}function handleGesture(gesture_str)    if handle_table[gesture_str] ~= nil then        handle_table[gesture_str](gesture_str)        return true    end    return falseend